import React, { useState, useContext, useEffect } from "react";
import ReactDOM from "react-dom/client";
import { NavLink, Form, useRouteLoaderData } from "react-router-dom";
import Avatar1 from "./assets/chooseyou-logo-header-2.svg";
import Avatar2 from "./assets/chooseyou-hamburger-menu.svg";
import Avatar3 from "./assets/chooseyou-logo-icon.png";

import { NavContext } from "./NavContext";
import {
  motion,
  useScroll,
  useTransform,
  AnimatePresence,
} from "framer-motion";

import BookingSignup from "./BookingSignup";
import classes from "./MainNavigation.module.css";

function MainNavigation() {
  const [matches, setMatches] = useState(
    window.matchMedia("(min-width: 768px)").matches
  );

  useEffect(() => {
    window
      .matchMedia("(min-width: 768px)")
      .addEventListener("change", (e) => setMatches(e.matches));
  }, []);
  const { showNav, setShowNav } = useContext(NavContext);
  const navMenu = () => {
    console.log(showNav);
    setShowNav(!showNav);
  };
  const transition_text = {
    duration: 0.33,
    ease: "easeInOut",
  };

  return (
    <>
      {!matches && (
        <NavContext.Provider value={{ showNav, setShowNav, navMenu }}>
          <AnimatePresence>
            {showNav && (
              <motion.div
                key="nav_text"
                initial={{ opacity: 0, x: 300, zIndex: 10 }}
                animate={{ opacity: 1, x: 0 }}
                transition={transition_text}
                exit={{ opacity: 0, x: 300 }}
                className={classes.listContainer}
                id="navBody"
              >
                <motion.div
                  className={classes.listOuter}
                  onClick={navMenu}
                ></motion.div>
                <motion.div className={classes.listLineBreak}></motion.div>
                <motion.ul className={classes.list}>
                  <motion.li className={classes.navLogoContainer}>
                    <motion.img className={classes.navLogo} src={Avatar3} />
                  </motion.li>
                  <motion.li className={classes.listElement}>
                    <NavLink
                      to="/"
                      className={({ isActive }) =>
                        isActive ? classes.active : undefined
                      }
                      onClick={navMenu}
                    >
                      Home
                    </NavLink>
                  </motion.li>
                  <motion.li className={classes.listElement}>
                    <NavLink
                      to="/coaching"
                      className={({ isActive }) =>
                        isActive ? classes.active : undefined
                      }
                      onClick={navMenu}
                    >
                      Coaching
                    </NavLink>
                  </motion.li>
                  {/* <li className={classes.listElement}>
            <NavLink
              to="/yoga"
              className={({ isActive }) =>
                isActive ? classes.active : undefined
              }
              onClick={navMenu}
            >
              Yoga
            </NavLink>
          </li> */}
                  {/* <motion.li className={classes.listElement}>
                  <NavLink
                    to="/about"
                    className={({ isActive }) =>
                      isActive ? classes.active : undefined
                    }
                    onClick={navMenu}
                  >
                    About
                  </NavLink>
                </motion.li> */}
                  <motion.li className={classes.listElement}>
                    <NavLink
                      to="/resources"
                      className={({ isActive }) =>
                        isActive ? classes.active : undefined
                      }
                      onClick={navMenu}
                    >
                      Resources
                    </NavLink>
                  </motion.li>
                  <BookingSignup />
                </motion.ul>
              </motion.div>
            )}
          </AnimatePresence>
        </NavContext.Provider>
      )}
      <header className={classes.header_1}>
        <nav className={classes.navContainer}>
          <div className={classes.logoContainer}>
            <img className={classes.logo} src={Avatar1} />
          </div>
          {matches && (
            <NavContext.Provider value={{ showNav, setShowNav, navMenu }}>
              <AnimatePresence>
                {showNav && (
                  <motion.div
                    key="nav_text"
                    initial={{ opacity: 0, x: 300, zIndex: 10 }}
                    animate={{ opacity: 1, x: 0 }}
                    transition={transition_text}
                    exit={{ opacity: 0, x: 300 }}
                    className={classes.listContainer}
                    id="navBody"
                  >
                    <motion.div
                      className={classes.listOuter}
                      onClick={navMenu}
                    ></motion.div>
                    <motion.div className={classes.listLineBreak}></motion.div>
                    <motion.ul className={classes.list}>
                      <motion.li className={classes.navLogoContainer}>
                        <motion.img className={classes.navLogo} src={Avatar3} />
                      </motion.li>
                      <motion.li className={classes.listElement}>
                        <NavLink
                          to="/"
                          className={({ isActive }) =>
                            isActive ? classes.active : undefined
                          }
                          onClick={navMenu}
                        >
                          Home
                        </NavLink>
                      </motion.li>
                      <motion.li className={classes.listElement}>
                        <NavLink
                          to="/coaching"
                          className={({ isActive }) =>
                            isActive ? classes.active : undefined
                          }
                          onClick={navMenu}
                        >
                          Coaching
                        </NavLink>
                      </motion.li>
                      {/* <li className={classes.listElement}>
            <NavLink
              to="/yoga"
              className={({ isActive }) =>
                isActive ? classes.active : undefined
              }
              onClick={navMenu}
            >
              Yoga
            </NavLink>
          </li> */}
                      {/* <motion.li className={classes.listElement}>
                  <NavLink
                    to="/about"
                    className={({ isActive }) =>
                      isActive ? classes.active : undefined
                    }
                    onClick={navMenu}
                  >
                    About
                  </NavLink>
                </motion.li> */}
                      <motion.li className={classes.listElement}>
                        <NavLink
                          to="/resources"
                          className={({ isActive }) =>
                            isActive ? classes.active : undefined
                          }
                          onClick={navMenu}
                        >
                          Resources
                        </NavLink>
                      </motion.li>
                      <BookingSignup />
                    </motion.ul>
                  </motion.div>
                )}
              </AnimatePresence>
            </NavContext.Provider>
          )}
          <div className={classes.menuContainer}>
            <img onClick={navMenu} className={classes.menu} src={Avatar2} />
          </div>
        </nav>
      </header>
    </>
  );
}

export default MainNavigation;
